import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";

import Cart1 from "./smallComponent/Cart1";
import LoginComponent1 from "./smallComponent/LoginComponent1";

const Header = () => {
  return (
    <Box className="Header_Component">
      <img src="https://i.pinimg.com/originals/82/be/d4/82bed479344270067e3d2171379949b3.png" alt="" />
      <Cart1 />
      <LoginComponent1 />
    </Box>
  );
};

export default Header;
